import React from 'react';
import logo from './logo.svg';
import './App.css';

//Common
import Title from './Components/Common/Title';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Title>Este es el Titulo</Title>
      </header>
    </div>
  );
}

export default App;
